import React from 'react'
import {Box, makeStyles} from '@material-ui/core'

const styleclass=makeStyles((theme) => {
    image:{
        height:"100px"
    }
})

function DisplayPost() {
    return (
        <Box>
            <img src='https://images.unsplash.com/photo-1543128639-4cb7e6eeef1b?ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8bGFwdG9wJTIwc2V0dXB8ZW58MHx8MHx8&ixlib=rb-1.2.1&w=1000&q=80'/>
        </Box>
    )
}

export default DisplayPost
